import logo from './assets/img1.jpg';

function App() {
  return (
    <div className="App bg-blue-200 h-screen flex items-center justify-center">
      <header className="App-header">
        <div>
          <img src={logo} />
        </div>
        <a>Hello my name is Arda</a>
      </header>
    </div>
  );
}

export default App;
